@rstudio @stefanbache A lot more people use `%&gt;%` than the siblings though, so you might have to be a bit careful.. eg. your team-mate might not understand your code or catch bugs as easily.

Also, they might not be compatible with other functions (eg. `%$%` and  tidy eval ğŸ˜”)

