@rstudio @stefanbache But did you know that the forward pipe has three siblings? :D

`%&lt;&gt;%` is probably the next well known of the three: it pipes the value of a variable down a chain, then reassigns that new value to the original variable.

I like not starting my chain with `object &lt;- object` ğŸ˜ https://t.co/uIxecCT2Cs

